import React from 'react';
import ReactDOM from 'react-dom';
import Card from './List';
import Para from './Para';

function hello(val){
return (<Card 
  imgsrc={val.imgsrc}
  title = {val.title}
  sname={val.sname}
  link={val.link}
  />)
}


ReactDOM.render(  <>

  {Para.map(hello)}
  </>
  , document.getElementById('root')
);
